import React from 'react';
import Card from './card';
import './card_sugges.css';
import SuggestionCard from './card_sugges_json';
import ClassSuggesTitle from './card_sugges_title'

class CardSuggestion extends React.Component{
  render(){
    return(
      <div>
      <ClassSuggesTitle/>
      <div className="card-deck pt-5 col-12 cardsugges">
      {SuggestionCard.map((item,index)=>{
        return(
            <div key={index} className="card cardcard">
              <center><img className="imgcard card-img-top img-fluid" src={item.url}/></center>
              <div className="card-body cardtext">
              <div dangerouslySetInnerHTML={{__html:item.text}}>
              </div>
              </div>
            </div>
        )})}
      </div>
  </div>
  )}}
export default CardSuggestion
